import React from 'react';
import '../Images/ufoInSF.png'
import Studies from './Profile/Studies';
import Languages from './Profile/Languages';
import Voluntering from './Profile/Voluntering';
import Experience from './Profile/WorkExperience';
import { Switch, Route, NavLink, Redirect } from 'react-router-dom';
import '../app.css';

const Profile: React.SFC = () => {
  const lStyles: string = "link dim dark-gray f6 f5-ns dib mr3 mr4-ns hover-bg-light-";
  return (
    <section className="mw8 center avenir">

      <nav className="w-100 border-box pa3">
        <div className="dtc v-mid w-75 tr">
          <a className="link dim dark-gray f6 f5-ns dib mr3 mr4-ns" href="#" title="About">Services</a>
          <a className="link dim dark-gray f6 f5-ns dib mr3 mr4-ns" href="#" title="Store">Blog</a>
          <a className="link dim dark-gray f6 f5-ns dib" href="#" title="Contact">Join Us</a>
          <NavLink to="/profile/languages" className={`${lStyles}yellow`}>Languages</NavLink>
          <NavLink to="/profile/studies" className={`${lStyles}blue`}>Studies</NavLink>
          <NavLink to="/profile/experience" className={`${lStyles}pink`}>Experience</NavLink>
          <NavLink to="/profile/voluntering" className={`${lStyles}grey`}>Voluntering</NavLink>
        </div>
      </nav>



          <div className="w-100 w-75-ns pl5-ns">
            <Switch>
              <Route exact path="/profile" render={() => <Redirect to="/profile/languages" />}/>
              <Route path="/profile/languages" render={() => <Languages />}/>
              <Route path="/profile/studies" render={() => <Studies />}/>
              <Route path="/profile/experience" render={() => <Experience />}/>
              <Route path="/profile/voluntering" render={() => <Voluntering />}/>
            </Switch>
            <h1 className="f3 fw1 baskerville mt0 lh-title">Tech Giant Invests Huge Money to Build a Computer Out of Science Fiction</h1>
            <p className="f6 f5-l lh-copy">
              The tech giant says it is ready to begin planning a quantum
              computer, a powerful cpu machine that relies on subatomic particles instead
              of transistors.
            </p>
            <p className="f6 lh-copy mv0">By Robin Darnell</p>
          </div>
    </section>  
  );
}

export default Profile;
